// CHALLENGE: uncomment the code below and see the car stats rendered
// import React from "react";
// import ReactDOM from "react-dom";

import cars from './practice';

const [honda, tesla] = cars;

// let {model, coloursByPopularity, speedStats} = honda;
// console.log(model)

let teslaTopSpeed = tesla.speedStats[0];
let teslaTopColour = tesla.coloursByPopularity[0];

let hondaTopSpeed = honda.speedStats[0];
let hondaTopColour = honda.coloursByPopularity[0];

ReactDOM.render(
  <table>
    <tr>
      <th>Brand</th>
      <th>Top Speed</th>
    </tr>
    <tr>
      <td>{tesla.model}</td>
      <td>{teslaTopSpeed}</td>
      <td>{teslaTopColour}</td>
    </tr>
    <tr>
      <td>{honda.model}</td>
      <td>{hondaTopSpeed}</td>
      <td>{hondaTopColour}</td>
    </tr>
  </table>,
  document.getElementById("root")
);
